import React from "react";
import "./css/CovidAdd.css";
import { HiOutlineChevronDoubleRight } from "react-icons/hi";
import WarningIcon from "@material-ui/icons/Warning";
import ArrowForwardIosIcon from "@material-ui/icons/ArrowForwardIos";
// import { Router, Link } from "react-router-dom";

function CovidAdd() {
  let date = new Date();
  date.toString();
  const months = [
    "Jan",
    "Feb",
    "Mar",
    "Apr",
    "May",
    "Jun",
    "Jul",
    "Aug",
    "Sep",
    "Oct",
    "Nov",
  ];
  let days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  const [today, day_idx, month_idx, year] = [
    date.getDate(),
    date.getDay(),
    date.getMonth(),
    date.getFullYear(),
  ];
  let current_month = months[month_idx];
  let today_day = days[day_idx];
  return (
    <div className="covid">
      <div className="alert__text">
        <p>
          <span className="alert__icon">
            {<WarningIcon className="warning__icon" />}
          </span>
          <span className="news__covid">Update news </span>
          Information about Covid-19
          <span className="covid__link">Learn more</span>
          <ArrowForwardIosIcon />
        </p>
      </div>
      <div className="date__container">
        <p>
          <span className="date__prop">
            {today} {current_month} {year}
          </span>
          <span className="date__day">{today_day}</span>
        </p>
      </div>
    </div>
  );
}

export default CovidAdd;
